import React from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import AddTaskIcon from '@mui/icons-material/AddTask';
const InputBar = () => {

    const event = () => {
        document.getElementById("dis_none").style.display = "none";
    }

    return (<>
        <div className="container upperwala">
            <div className=" upperwala2">
                <div id="dis_none" className="input-group ">
                    <input style={{ border: "none" }} onClick={event} type="text" className="form-control forDisplay" placeholder="Recipient's username" aria-label="Recipient's username" aria-describedby="button-addon2" />
                </div>
                <div className="mb-3">
                    <input style={{ border: "none" }} type="email" className="form-control" id="exampleFormControlInput1" placeholder="Title" />
                </div>
                <div className="mb-3">
                    <label for="exampleFormControlTextarea1" className="form-label d-flex mt-2 "><AddTaskIcon /></label>
                </div>
            </div>
        </div>

    </>)
}
export default InputBar;
